import React, { useEffect, useState } from 'react';

function DataFetching() {

const [advice, setAdvice] = useState([]);

  useEffect(()=>{

    const url = "/api/stations/";

    let method = "GET";

    const fetchData = async (url, method) => {
        try {
            const response = await fetch(url, {
                method: method,
                mode: 'no-cors'
            })

            const json = await response.json();
            console.log(json);
            setAdvice(json);
        } catch (error) {
            console.log("error", error);
        }
    }

    fetchData(url, method);
}, []);

return (
    <div className = "App">

    { advice.map((el, index) => {
             let record
                for (const key in el) {
                    record.id = el.id,
                    record.fid = el.fid,
                    record.name = el.name,
                    record.address = el.address,
                    record.x = el.x,
                    record.y = el.y,
                    record.total_journeys_starting = el.total_journeys_starting,
                    record.total_journeys_ending = el.total_journeys_ending
                }
                row.push(record)
            return record
            })}
        </div>
    );
}

export default DataFetching;
